function RGBToGrayScale(r,g,b){
 return parseInt(0.2126*r+0.7152*g+0.0722*b);
}

function GetHashCode(data,imageWidth,imageHeight)
{
 var row_hash="";
 for(var r=0;r<imageHeight;r++){
  for(var c=0;c<imageWidth;c++){
   var red=data[((imageWidth*r)+ c)*4];   
   var red1=data[((imageWidth*r)+c+1)*4];
   if (red1>=red)
    row_hash+="1";
   else
    row_hash+="0";
  }
 } 
 var col_hash="";
 for(var c=0;c<imageWidth;c++){
  for(var r=0;r<imageHeight;r++){
   var red=data[((imageWidth*r)+c)*4]; 
   var red1=data[((imageWidth*(r+1))+c)*4];
   if (red1>=red)
    col_hash+="1";
   else
    col_hash+="0";
  }
 }
 return row_hash+col_hash;
}

function CompareHashes(hash_code1,hash_code2)
{
 var diffscore=0;
 const length=hash_code1.length;
 for (var i=0;i<length;i++){
  if (hash_code1.charAt(i)!=hash_code2.charAt(i)){
   diffscore++;
  }
 }
 var percent=(((length-diffscore)/length)*100).toFixed(2);
 return [diffscore,percent];
}

function checkHash(hash_code)
{
 var cnt=0;
 const length=hash_code.length;
 for (var i=0;i<length;i++){
  if (hash_code.charAt(i)=="1"){
   cnt++;
  }
 }
 if(cnt==162)
  return false;
 else 
 return true;
}

