var ClipboardUtils=new function(){
 var permissions={
  'image/bmp': true,
  'image/gif': true,
  'image/png': true,
  'image/jpeg': true,
  'image/tiff': true
 };

 function getType(types){
  for(var j=0;j<types.length;++j){
   var type=types[j];
    if (permissions[type]){
     return type;
    }
  }
  return null;
 }
 function getItem(items){
  for (var i=0;i<items.length;++i){
   var item=items[i];
   if(item){
    var type=getType(item.types);
    if(type){
     return item.getType(type);
    }
   }
  }
  return null;
 }
 function loadFile(file,callback){
  if(window.FileReader){
   var reader=new FileReader();
   reader.onload=function(){
    callback(reader.result,null);
   };
   reader.onerror=function(){
    callback(null,'Incorrect file.');
   };
   reader.readAsDataURL(file);
   }else{
    callback(null,'File api is not supported.');
  }
 }

 this.readImage=function(callback){
 if(navigator.clipboard){
  try{
   var promise=navigator.clipboard.read();
   promise
   .then(function(items){
    var promise=getItem(items);
    if(promise){
     promise
      .then(function(result){
       loadFile(result,callback);
      })
      .catch(function(error){
       callback(null,'Reading clipboard error.');
      });
     }else{
      callback(null,null);
     }
    })
    .catch(function(error){
     callback(null,'Reading clipboard error.');
     alert("In this browser use Ctrl+V to paste image from clipboard.") 
    });
   }
   catch(err){
    alert("In this browser use Ctrl+V to paste image from clipboard.")
   }
  }else{
   callback(null,'Clipboard is not supported.');
  }
 };
};

