function mySort(){
 var columns,row,switching,i,x,y,shouldSwitch;
 var maxCols=0;
 row=table.rows[0];
 switching=true;
 columns=row.cells;
 maxCols=columns.length-1;
 while(switching){
  switching=false;  
  for(i=0;i<maxCols;i++){
   shouldSwitch=false;
   x=columns[i].textContent;
   let xp1=x.indexOf("(");
   let xp2=x.indexOf(")");
   let xperc=parseFloat(x.substring(xp1+1,xp2-1));
   y=columns[i+1].textContent;
   let yp1=y.indexOf("(");
   let yp2=y.indexOf(")");
   let yperc=parseFloat(y.substring(yp1+1,yp2-1));
   if(yperc>xperc) {
    shouldSwitch=true;
    break;
   }
  }
  if(shouldSwitch){
   row.insertBefore(row.children[i+1], row.children[i]);
   switching=true;
  }
 }
}

